import AdminContainer from "./pages/Admin/AdminContainer"
import Auth from "./pages/Auth/Auth"
import Authcontainer from "./pages/Auth/AuthContainer"
import BasketContainer from "./pages/BasketContainer"
import productContainer from "./pages/productPage/productContainer"
import Shop from "./pages/Shop/Shop"
import ShopContainer from "./pages/Shop/ShopContainer"
import { ADMIN_ROUTE, BASKET_ROUTE, LOGIN_ROUTE, PRODUCTS_ROUTE, REGISTRATION_ROUTE, SHOP_ROUTE } from "./utils/consts"

export const authRoutes = [
    {
        path: ADMIN_ROUTE,
        Component: AdminContainer
    },
    {
        path: BASKET_ROUTE,
        Component: BasketContainer
    }
]

export const publicRoutes = [
    {
        path: SHOP_ROUTE,
        Component: ShopContainer
    },
    {
        path: LOGIN_ROUTE,
        Component: Authcontainer
    },
    {
        path: REGISTRATION_ROUTE,
        Component: Authcontainer
    },
    {
        path: PRODUCTS_ROUTE + '/:id',
        Component: productContainer
    }
]
